var handleDataTableResponsive = function () {
        "use strict";
        0 !== $("#data-table").length && $("#data-table").DataTable({
            responsive: !0,
            bLengthChange: !1
        })
    },
    PageDemo = function () {
        "use strict";
        return {
            init: function () {
                handleDataTableResponsive()
            }
        }
    }();